import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Routes, useLocation } from 'react-router-dom';
import Home from './pages/Home';
import Treatment from './pages/Treatment';
import Blogs from './pages/Blogs';
import AboutMe from './pages/AboutMe';
import { useEffect, useState } from 'react';
import TreatmentDetails from './pages/TreatmentDetails';
import BlogDetails from './pages/BlogDetails';
import Booking from './pages/Booking';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Profile from './pages/Profile';
import Appointment from './pages/Appointment';


function App() {
  const [treat, setTreat] = useState("");
  const [blog, setBlog] = useState("");
  const [login, setLogin] = useState(false)
  const [userLoginInfo, setUserLoginInfo] = useState();


  fetch('http://localhost:5050/auth/validatesession', {
    method: 'GET',
    credentials: 'include', // Include credentials (cookies) with the request
  })
    .then(response => {
      if (response.ok) {
        // Successful response from the protected route
        setLogin(true)
        return response.json();
      } else if (response.status === 401) {
        setLogin(false)
        // Unauthorized access, handle accordingly
        console.error('Unauthorized access');
      } else {
        // Other errors, handle accordingly
        console.error('Unexpected error:', response.statusText);
      }
    })
    .then(data => {
      // Handle the data returned from the protected route
      console.log('Data from protected route:', data);
    })
    .catch(error => {
      // Handle network errors or other issues
      console.error('Error during request:', error.message);
    });
  // const fetchSession = async () => {
  //   try {
  //     const response = await fetch("http://localhost:5050/auth/validatesession", {
  //       credentials: "include",
  //       mode: 'cors',
  //       headers: {
  //         'Access-Control-Allow-Origin': '*'
  //       }
  //     });
  //     if (response.status === 200) {
  //       setLogin(true)
  //     } else {
  //       setLogin(false)
  //     }
  //   } catch (error) {
  //     console.error("Error during session validation:", error.message);
  //   }
  // };
  // console.log(login);

  // fetchSession();
  console.log(userLoginInfo);
  const ScrollToTop = () => {
    const { pathname } = useLocation();
    useEffect(() => {
      window.scrollTo(0, 0);
    }, [pathname]);

    return null;
  };

  return (
    <div className="App">
      <BrowserRouter>
        <Navbar login={login} setLogin={setLogin} />
        <ScrollToTop />
        <Routes>
          <Route path='/' element={<Home login={login} setTreat={setTreat} setBlog={setBlog} />} />
          <Route path="treatment" element={<Treatment setTreat={setTreat} />} />
          <Route path="blogs" element={<Blogs setBlog={setBlog} />} />
          <Route path="about-me" element={<AboutMe />} />
          <Route path="/treatment-details" element={<TreatmentDetails data={treat} />} />
          <Route path="/blogs-details" element={<BlogDetails data={blog} />} />
          <Route path='/booking' element={<Booking userID={userLoginInfo} />} />
          <Route path='/login' element={<Login setLogin={setLogin} setUserLoginInfo={setUserLoginInfo} />} />
          <Route path='/signup' element={<Signup />} />
          <Route path='/profile' element={<Profile />} />
          <Route path='/appointment' element={<Appointment />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
